import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {addPost, rewritePostText, addMsg, newMsgPost} from './redux/state';
import {BrowserRouter} from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));

export let rerenderEntireTree = (state) => {
    root.render(
        <BrowserRouter>
            <React.StrictMode>
                <App 
                    appState={state} 
                    addPost={addPost} 
                    rewritePostText={rewritePostText}
                    addMsg={addMsg}
                    newMsgPost={newMsgPost} /> 
            </React.StrictMode>
        </BrowserRouter>
    );
};

reportWebVitals();
